@toimen ところで昨日言ってた109のページ開かないのってこれのせいなの？「ファーストサーバー」データ消失被害の国内ウェブページ一覧 | ICT Headline directed by Ｐ検 http://t.co/xDiaRnuq via @ICT_Headline
            デジタル・ネイティブ・ユーザーの情報源, ICT Headlineでも取り上げた、ファーストサーバのデータ消失による影響が広がっている。5万社とも言われる同社顧客のうち、数千社規模での被害との報道も始まっており、ホスティング会社のトラブルは未曾有の被害となる可能性も出てきた。ICT Headlineでは、国内のホームページから、今回のファーストサーバのデータ消失による影響を受けたウェブページの一覧を作成した。現時点で復旧しているものもあれば、全く復旧できていないものもある。, ICT Headlineでも取り上げた、ファーストサーバのデータ消失による影響が広がっている。5万社とも言われる同社顧客のうち、数千社規模での被害との報道も始まっており、ホスティング会社のトラブルは未曾有の被害となる可能性も出てきた。ICT Headlineでは、国内のホームページから、今回のファーストサーバのデータ消失による影響を受けたウェブページの一覧を作成した。現時点で復旧しているものもあれば、全く復旧できていないものもある。, ICT Headlineでも取り上げた、ファーストサーバのデータ消失による影響が広がっている。5万社とも言われる同社顧客のうち、数千社規模での被害との報道も始まっており、ホスティング会社のトラブルは未曾有の被害となる可能性も出てきた。ICT Headlineでは、国内のホームページから、今回のファーストサーバのデータ消失による影響を受けたウェブページの一覧を作成した。現時点で復旧しているものもあれば、全く復旧できていないものもある。
